package Utils;

public class ArraysUtils {
	public ArraysUtils() {
		// TODO Auto-generated constructor stub
	}

	public static void printf(int[] a) {
		for (Object digit : a) {
			System.out.println(digit + " ");

		}
	}

	public static void printf(String[] a) {
		for (Object digit : a) {
			System.out.println(digit + " ");
		}
	}

	public static void printf(Object[] a) {
		for (Object digit : a) {
			System.out.println(digit + " ");
		}
	}
}
